import { Container } from "react-bootstrap";
import CategoryBtn from "../categoryButton/CategoryBtn";
import './tattoostyle.css'

const TattooStyle = () => {


    return (
        <Container>
            <div className="row">
                <div className="col">
                    <div className="d-flex gap-2">
                        <CategoryBtn categoryName={'Blackwork'}/>
                        <CategoryBtn categoryName={'Blackwork'}/>
                        <CategoryBtn categoryName={'Blackwork'}/>
                        <CategoryBtn categoryName={'Blackwork'}/>
                        <CategoryBtn categoryName={'Blackwork'}/>
                        <CategoryBtn categoryName={'Blackwork'}/>
                        <CategoryBtn categoryName={'Blackwork'}/>
                        <CategoryBtn categoryName={'Blackwork'}/>
                        <CategoryBtn categoryName={'Blackwork'}/>
                    </div>
                </div>
            </div>
        </Container>
    );
}

export default TattooStyle;
